import React from 'react';
import '../styles/Gallery.css';

const Gallery: React.FC = () => {
  const images = [
    { src: '/images/southkorea.jpg', caption: 'South Korea' },
    { src: '/images/japan.jpg', caption: 'Japan' },
    { src: '/images/china.jpg', caption: 'China' },
    { src: '/images/vietnam.jpg', caption: 'Vietnam' },
    { src: '/images/singapore.jpg', caption: 'Singapore' },
  ];

  return (
    <section className="gallery-section">
      <h2>Photo Gallery</h2>
      <div className="gallery-grid">
        {images.map((image, index) => (
          <div className="gallery-item" key={index}>
            <img src={image.src} alt={image.caption} className="gallery-image" />
            <div className="gallery-text">{image.caption}</div>
          </div>
        ))}
      </div>
    </section>
  );
};
export default Gallery;
